import {TestModel, TestModelSdkClient} from '../test-index';

export function withWarnFunc(warnFunc, execFunc:Function) {
	const oldConsoleWarn = console.warn;
	try {
		console.warn = warnFunc;
		execFunc();
	} finally {
		console.warn = oldConsoleWarn;
	}
}